import React, { Component } from 'react';
import Header from '../component/Header';
import Footer from '../component/Footer';

const Skills = () => {
  return (
    <div>
      <Header title="Skills"></Header>
      <div className="Skills">
        <ul>
          <li>JavaScript</li>
          <li>React</li>
          <li>Express</li>
          <li>Node JS</li>
          <li>Docker</li>
          <li>D3</li>
          <li>git</li>
          <li>Bootstrap</li>
          <li>Webpack</li>
          <li>Styled Component</li>
          <li>Rest API</li>
        </ul>
      </div>
      <Footer></Footer>
    </div>
  );
};

export default Skills;
